import React, { useState, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import {fetchData, addWhiteList} from "../redux/actions";
// import {dataReducer} from "../redux/reducers";
import axios from "axios";
import {
  Grid,
  Typography,
  Table,
  TableContainer,
  TableHead,
  TableBody,
  TableCell,
  Switch,
  TableRow,
  Button,
} from "@material-ui/core/";

function Home() {
//   axios
//     .get("https://api.jokolodang.com/api/v1/payments")
//     .then((res) => console.log(res));

    const dispatch = useDispatch();
    console.log(dispatch(addWhiteList()));
    
  // state init
  const [active, setactive] = useState({ statusSwitch: false });
  const whitelist = useSelector((state) => state.whitelist);
    console.log(whitelist, active);

  const handleChange = () => {
    setactive({
      statusSwitch: !active.statusSwitch,
    });
  };

  const handleDelete = () => {
    return null;
  };

  return (
    <Grid container item xs={12} justify="center" alignItems="center">
      <Grid item xs={10}>
        <TableContainer>
          <Table aria-label="simple-table">
            <TableHead>
              <TableRow>
                <TableCell>id</TableCell>
                <TableCell>name</TableCell>
                <TableCell>active</TableCell>
                <TableCell>delete</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              <TableRow>
                <TableCell>1</TableCell>
                <TableCell>Asep Imam Nawawi</TableCell>
                <TableCell>
                  <Switch
                    checked={active.statusSwitch}
                    onChange={handleChange}
                    name="checkedA"
                  />
                </TableCell>
                <TableCell>
                  <Button onClick={handleDelete}>Delete</Button>
                </TableCell>
              </TableRow>
            </TableBody>
          </Table>
        </TableContainer>
      </Grid>
    </Grid>
  );
}

export default Home;
